/* IMPORT AND EXPORT IN REACT */

import React from "react";
import ReactDom from "react-dom";
import youtuber,{project,favgame} from "./Bekar bhaiya";


ReactDom.render(
    <>  
    <ul>
        <li>My favorite youtube channel is {youtuber()}</li>
        <li>My favorite game is {favgame()}</li>
        <li>My best ever poject name is {project()}</li>
    </ul>
    </>,document.getElementById("root")
);
